import { Injectable } from '@angular/core';
import { ComplicationCrisesDouleureuse } from '../models/ComplicationCrisesDouleureuse';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class CriseService {

  private apiUrl = 'https://localhost:7129/api/ComplicationCrisesDouleureuses';

  constructor(private http: HttpClient) { }
  addcrise(ComplicationCrisesDouleureuse: ComplicationCrisesDouleureuse): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationCrisesDouleureuse);

    return this.http.post<any>(`${this.apiUrl}/addcrise`, ComplicationCrisesDouleureuse, { observe: 'response' });
  }
  getById(patientId: number): Observable<any> {
    return this.http.get<any>(`${this.apiUrl}/${patientId}`);
  }
/*
  update(patientId: number, data: any[]): Observable<any> {
