  }
  updateComplication(complication: ComplicationCrisesDouleureuse): Observable<any> {
    const url = `https://localhost:7129/api/ComplicationCrisesDouleureuses/update/${complication.PatientId}`;
    return this.http.put(url, complication);
}*/
  
update(patientID: number, complication: ComplicationCrisesDouleureuse): Observable<any> {
  const url = `https://localhost:7129/api/ComplicationCrisesDouleureuses/update/${patientID}`;
  return this.http.put(url, complication, {
    headers: new HttpHeaders({
      'Content-Type': 'application/json'
    })
  });
}
  
}
